import Navbar from "./components/Navbar";
import Carousel from "./components/Carousel";
import ProductsList from "./components/ProductsList";
import Product from "./components/Product";





function App() {
  return (
    <div className="App">
      <Navbar />
      <Routes>
        <Route></Route>
      </Routes>

      <Carousel />

      <ProductsList />
    </div>
  );
}

export default App;
